Лучший способ управлять услугами и счетом для абонентов Tele2 Россия.

Тарифы и услуги
— проверка остатков гигабайт и минут;
— настройка тарифа;
— подключение или отключение дополнительных услуг;
— возможность делиться гигабайтами с абонентами Tele2;
— удобный виджет для отслеживания остатков и баланса.

Управление счетом
— пополнение баланса с помощью банковской карты;
— установка автоплатежа с привязанной банковской карты;
— использование «Обещанного платежа»;
— просмотр статистики расходов и заказ детализации;

Больше
— скидки, кэшбэк и подарки от наших партнеров;
— уникальные предложения и приглашения на интересные события.

Меняйте тариф, управляйте сим-картами и следите за расходами в онлайне.

Закажите сим-карту в приложении и попробуйте Тинькофф Мобайл бесплатно. Пробный период связи — за наш счет: минуты, гигабайты и популярные сервисы. Потом тариф изменится на тот, который выберете вы. Сим-карту бесплатно доставит представитель.

Клиенты Тинькофф получат 3 месяца подписки Tinkoff Pro за перенос номера в нашу сеть. Это займет 8 дней.

Что удобно делать в приложении:
— следить за расходами по нескольким номерам и пополнять счет;
— подключить запись звонков, умного автоответчика и виртуальный номер бесплатно;
— настроить условия в роуминге, чтобы не волноваться за расходы на связь в поездке;
— обратиться за помощью в чат, даже если не подключен интернет.

eSIM доступна для держателей карт Тинькофф.

Приложение «Парковки России» - ваш персональный мобильный паркомат с набором полезных функций. Здесь вы узнаете всю информацию о городских и коммерческих парковках, их тарифах и вместимости и легко и удобно сможете их оплатить.

Приложение «Парковки России» работает с 2012 года (до февраля 2022 года под названием «Парковки Москвы»), это выбор более 8 миллионов водителей.

При поддержке Минтранса России через приложение можно оплатить парковку не только в Москве, но и в Санкт-Петербурге, а в будущем – и в других городах страны.

«Парковки России» – это:
• оплата парковок разных типов (уличных, со шлагбаумом, коммерческих, частных);
• возможность исправить ошибки, допущенные при оплате парковки (госномер авто, номер парковочной зоны или время завершения истекшей парковки);
• полная информация о парковках (их название, адрес, стоимость, вместимость и др.);
• управление парковочной сессией в одно-два нажатия (запуск, продление и завершение парковки);
• полная отчетность и выгрузка истории оплат;
• проверка и оплата штрафов за нарушения правил остановки, стоянки и парковки (в Москве);
• проверка и оплата эвакуации автомобиля (в Москве) и многое другое!

Мы продолжаем улучшать «Парковки России» и ежегодно добавляем новые функции. Присылайте свои предложения!

«Мой Триколор» — это удобный и многофункциональный Личный кабинет клиента Триколора.

Объединяйте свои Триколор ID:
— не нужна авторизация для каждого Триколор ID;
— управление услугами в одном Личном кабинете;
— оплата услуг, баланс и история платежей доступны в одном месте;
— перенос средств между объединенными Триколор ID.

Функции приложения:
— управление услугами и подключение новых;
— удобные способы оплаты, включая систему быстрых платежей;
— самостоятельный обмен оборудования, заказанного через интернет-магазин;
— функция «Автоплатеж» и просмотр истории операций;
— изменение и подтверждение контактных данных;
— управление устройствами, привязанными к одному Триколор ID;
— восстановление просмотра ТВ с помощью повтора команд активации и простых инструкций.

Преимущества приложения:
— узнавайте первым о доступных акциях и специальных предложениях;
— быстро находите ответы на вопросы: как проверять силу и качество спутникового сигнала, поиск спутниковых каналов и многое другое;
— оставайтесь в курсе всех сервисов Триколора;
— просматривайте актуальный список каналов, входящих в подписку;
— смотрите любимые каналы непрерывно с опцией «Автоплатеж».

Объединяйте Триколор ID и управляйте услугами в Личном кабинете «Мой Триколор».

Наше приложение откроет вам доступ к управлению услугами связи ГПБ Мобайл.
С помощью него вы можете:
- просматривать информацию о балансе и остаткам подключенных пакетов;
- подключать услуги и дополнительные опции;
- менять тарифный план;
- заказать детализацию вызовов
- оплачивать услуги банковской картой и многое другое.

Приложение бесплатно и не расходует трафик.

