Приложение позволяет отслеживать статусы доставки заказов из интернет-магазинов в Постаматы и пункты выдачи PickPoint. 

Зарегистрировав приложение на свой номер телефона, можно видеть:
- все заказы, оформленные на указанный номер телефона;
- статусы и историю доставки  сделанных заказов;
- подробное описание местонахождения Постамата (или пункта выдачи заказов), а также график его работы, варианты оплаты, фотографию места установки Постамата.

Дополнительные функции приложения:
- продлить срок хранения заказа в Постамате;
- поделиться впечатлениями о процессе получения заказа.
- получение PUSH-уведомлений о доставке заказа
- возможность отказаться от получения SMS (получение только PUSH-уведомлений)
- отображение поля: "код получения" (для открытия ячейки)
- кнопка "написать e-mail" (вопросы по получению заказа)
- "Обратный звонок" -заказ экстренного звонка на телефон получателя
- кнопка "поделиться" - поделиться своими впечатлениями о получении заказа в постамате в социальных сетях

Приложение разработано специально для пользователей доставки через  Постаматы и пункты выдачи PickPoint по России с целью отслеживания статуса и последующего максимально комфортного получения заказов более чем из 600 интернет-магазинов.

