Поиск на карте/определение ближайшей к вашему местонахождению точки;
Фильтр по графику работы.


Обратная связь
Оценка качества доставки конкретного заказа;
Автоматизированная форма отправки e-mail сообщений в адрес PickPoint.

Настройки
Личный профиль в разделе «Мои заказы», позволяет ввести и настраивать индивидуальные настройки для работы с приложением;
Возможность удаления любого заказа из общего списка; 

А так же
Поиск нужного интернет-магазина с использованием фильтров товарных категорий и ключевых слов поиска;
Информация о сервисе, стоимости и сроках доставки, а также сроки хранения;
Инструкции по получению заказов в постамате и пункте выдачи.
